import { useState, useEffect } from "react";

function Dashboard() {
  const [loading, setLoading] = useState(true);
  const [results, setResults] = useState("");
  const [count, setCount] = useState(0);

  useEffect(() => {
    fetch("http://20.191.211.229:5000/v1/datafiles?filetype=tdf&max_size=30", {
      method: "GET",
      headers: {
        "Content-Type": "application/json"
      }
    })
      .then(res => {
        return res.json();
      })
      .then(data => {
        setLoading(false);
        setResults(data);
      });
  });

  return (
    <div>
      {loading || !results ? (
        <h1>Loading...</h1>
      ) : (
        <div>
          {results.map(result => {
            setCount(count + 1);
            return (
              <div id={result.file_id}>
                <h3>Result {count}</h3>
                <p>{result.filename}</p>
                <p>{result.filetype}</p>
              </div>
            );
          })}
        </div>
      )}
    </div>
  );
}

export default Dashboard;
